import React, {Component} from "react";
import {
  Route,
  NavLink,
  HashRouter,
  BrowserRouter
} from "react-router-dom";

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Image from 'react-bootstrap/Image';

import FrontPage from "./FrontPage.js"
import AboutPage from "./AboutPage.js"
import PeoplePage from "./PeoplePage.js"
import ContactPage from "./ContactPage.js"
import NewsPage from "./NewsPage.js"

import flag from './imgs/flag.png';
import './App.css';

function App() {
  return (
    <HashRouter>
      <div>
        <BrowserRouter basename="/">
          <Navbar bg='light' expand="lg" sticky="top">
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav style={{width:"100%"}}>
              <div className="mycontainer">
                <Nav.Link className="align-item-center"><NavLink className="spaced_text text_18pt" to="/News">News</NavLink></Nav.Link>
                <Nav.Link className="align-item-center"><NavLink className="spaced_text text_18pt" to="/About">About</NavLink></Nav.Link>
                <Nav.Link className="align-item-center"><NavLink className="spaced_text text_24pt" to="/"><Image src={flag} rounded/></NavLink></Nav.Link>
                <Nav.Link className="align-item-center"><NavLink className="spaced_text text_18pt" to="/People">People</NavLink></Nav.Link>
                <Nav.Link className="align-item-center"><NavLink className="spaced_text text_18pt" to="/Contact">Contact</NavLink></Nav.Link>
              </div>
            </Nav>
          </Navbar.Collapse>
          </Navbar>

          <div className="content">
            <Route exact path="/" component={FrontPage}/>
            <Route path="/News" component={NewsPage}/>
            <Route path="/About" component={AboutPage}/>
            <Route path="/People" component={PeoplePage}/>
            <Route path="/Contact" component={ContactPage}/>
          </div>
        </BrowserRouter>
      </div>
    </HashRouter>
  );
}

export default App;
